function queryString (obj){
    let params = "";

    for (var key in obj){
        let curIndex = Object.keys(obj).indexOf(key);
        (curIndex === 0) ? params += encodeURIComponent(key) + "=" + encodeURIComponent(obj[key]) : 
        params += "&" + encodeURIComponent(key) + "=" + encodeURIComponent(obj[key]);
    }

    return params;
}

